import React from "react"
import { StoreTodo } from "../stores/NoteStore"
import ToDoItem from "./ToDoItem";

const ListOfItems = observer(() => {
    return(
        <div className="ContainerList">
            <div className="Note">
                wervevev
                sdcsec
                {StoreTodo.listOfItems.map(item => {
                    return(
                        <ToDoItem 
                            item={item}
                            key={item.id}
